<script>
import AnimatedBackground from "./AnimatedBackground.vue";
import { onMounted } from "@vue/runtime-core";
import { gsap } from "gsap";
export default {
  components: { AnimatedBackground },
  setup() {
    const timeline = gsap.timeline({
      defaults: { duration: 1, repeat: -1, yoyo: true, ease: "sine.inOut" },
    });
    const armsTimeline = gsap.timeline({
      defaults: {
        y: "3px",
        duration: 0.2,
        repeat: -1,
        yoyo: true,
        ease: "sine.inOut",
      },
    });

    onMounted(() => {
      armsTimeline.to("#right-arm", {}).to("#left-arm", {});

      timeline
        .to("#head", {
          y: "10px",
        })
        .to(
          "#vue",
          {
            y: "20%",
          },
          "<"
        )
        .from(
          "#firebase",
          {
            y: "400px",
          },
          "<.2"
        )
        .from(
          "#html",
          {
            y: "400px",
          },
          "<.3"
        )
        .to(
          "#javascript",
          {
            y: "40%",
          },
          "<.1"
        );

      gsap.from(".intro-text", {
        duration: 1,
        opacity: 0,
        ease: "sine.inOut",
        x: "20%",
      });

      gsap.from(".developer", {
        duration: 1.3,
        opacity: 0,
        scale: 0.3,
        rotation: 20,
        ease: "elastic.out",
      });
    });
  },
};
